import { NavLink } from "react-router-dom";

export default function Nav() {
    return (
        <nav>
            <NavLink to="/" end>Home</NavLink>
            <NavLink to="/Bookings">Booking</NavLink>
            <NavLink to="/Registration">Registration</NavLink>
            <NavLink to="/Login">Login</NavLink>
        </nav>
    );
}
